function mergeArrays(arr1, arr2) {
  const set = new Set();

  // Iterate through both arrays and add unique objects to the Set
  arr1.concat(arr2).forEach(obj => {
    const key = JSON.stringify([obj.stepId, obj.fieldId]);
    set.add(key, obj);
  });

  // Convert Set to an array and map the values to the desired format
  return Array.from(set.values()).map(obj => {
    const firstObj = arr1.find(o => JSON.stringify([o.stepId, o.fieldId]) === JSON.stringify([obj.stepId, obj.fieldId]));
    const secondObj = arr2.find(o => JSON.stringify([o.stepId, o.fieldId]) === JSON.stringify([obj.stepId, obj.fieldId]));

    return Object.assign({}, firstObj, secondObj.message ? { message: secondObj.message } : {});
  });
}

